import React from 'react';
import YoutubeEmbed from "./YoutubeEmbed";
import './youtubeembeded.css';

const ExportYoutubeVideo = () => {
  return (
    <div className="youtubevideo">
        <h1>How to play the game ? </h1>
      <YoutubeEmbed />
    </div>
  )
}

export default ExportYoutubeVideo
